import { InputBase,Box } from '@mui/material'
import React from 'react'

const Search = () => {
  return (
    <>
    <Box>
        <InputBase
        sx={{ ml: 1, flex: 1 }}
        placeholder="Search Google Maps"
        inputProps={{ 'aria-label': 'search google maps' }}
      />
    </Box>
    </>
  )
}

export default Search
